import React, { useState } from 'react';
export default function PropertyItem({ label }) {
    const [itemValue, setItemValue] = useState("Super Tank");
    const handleSelect = (e) => {
        setItemValue(e.target.value);
    }
    return (
        <>
            <div className="property-item-container">
                <label>{ label }</label>
                <select onChange={handleSelect} value={itemvalue}>
                    <option value="Super Tank" selected></option>
                    <option value="Tu-Tank-hamen"></option>
                    <option value="No Tanks!"></option>
                    <option value="Tank you!"></option>
                </select>
                <button>Update</button>
            </div>
        </>
    )
}
